    "High Performance Photocatalytic Oxidation Reactor System Project",nt"tracking_summary":
    {ntt"total": 12,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T01:25:41.913815",nt"name": "high-performance-photocatalytic-oxidation-reactor-system-project",nt"isopen":
    true,nt"url": null,nt"notes": "Pioneer Astronautics proposes a technology
    program for the development of an innovative photocatalytic oxidation reactor for
    the removal and mineralization of Volatile Organic Compounds to extend crewed space
    exploration beyond low earth orbit.  This novel technology, called the High Performance
    Photocatalytic Oxidation Reactor System (HPPORS) leverages recent progress in high
    power Light Emitting Diodes (LED) and efficient, visible wavelength photooxidation
    (PO) catalysts to completely oxidize Volatile Organic Compounds (VOCs) to carbon
    dioxide and water.  The basis of the innovation is the synthesis of commercial high
    power, high brightness LEDs with efficient geometric illumination of active visible-light
    activated PO catalyst in a high surface area to volume fiber optic reactor.   This
    combined approach leads to numerous performance benefits including high VOC conversion
    efficiency, compact reactor volume, and low pressure drop.  The development of the
    HPPORS technology will lead to a photocatalytic reactor that meets the rigorous
    compliance requirements of complete VOC mineralization to CO2 and H2O, while utilizing
    efficient visible LEDs or solar energy in a compact, scalable package.",nt"license_title":
